import React from 'react'


const lakes = async() => {
    await fetch('/lakes')
    .then(res => res.json())
    .then(rsp => console.log(rsp))
}

const Home = () =>{
    lakes()
    return <div>
        <h1>THIS IS HOME</h1>
        
    </div>
}
export default Home
